import React from "react";
import Mix from "../Mix";

const MixContainer = ({ mixes }) => (
  <div>
    {mixes.map((mix) => (
      <section>
        <h2>{mix.name}</h2>
        <p>{mix.url}</p>
      </section>
    ))}
  </div>
);

export default MixContainer;
